window.bookSummaryJSON = "<p><i>Don't let her mousy appearance fool you....</i></p> <p>McKenna Byrne is fire.</p> <p>Hot-tempered. Passionate. All-consuming. She seared my soul from our very first kiss.</p> <p>Once, she wanted a chance at independence. A life away from the Clan. </p> <p>Then danger threw us back together, And when McKenna and I collide...</p> <p>We ignite.</p> <p>Now I'm forced to claim her. To make her a full-fledged woman of the Clan. She might fight me tooth and nail, but we both love a challenge.</p> <p>This time, there'll be no escape for either of us.</p> <p>This time, we'll burn....</p>"; 
